var b="url",c="9_5_3_3_your_finances_-_benefits_-_serious_financi.html",d="generationDate",e=new Date(1420802781127.04),f="isCanvasEnabled",g=false,h="variables",i="OnLoadVariable",j="EmailVar",k="FullnameVar",l="ContactnumVar",m="UrnVar1",n="UrnVar2",o="UrnVar3",p="UrnVar4",q="DayVar",r="MonthVar",s="YearVar",t="AcoomodationVAR",u="InsuranceVAR",v="UtilityVAR",w="CounilTaxVAR",x="TVVAR",y="TravelVAR",z="LoanVAR",A="ChildVAR",B="TelephoneVAR",C="CountyCourtVAR",D="NumChargesVAR",E="page",F="packageId",G="74929a4d79e643f48a607c622e334074",H="type",I="Axure:Page",J="name",K="9.5.3.3 Your finances - benefits - serious financial problems",L="notes",M="Note",N="<p><span style=\"font-family:'Arial-BoldMT', 'Arial Bold', 'Arial';font-weight:700;\">Changes since last version 0.9.3</span></p><p><span style=\"font-family:'Arial-BoldMT', 'Arial Bold', 'Arial';font-weight:700;\">&nbsp;</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">Bullet points</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"></span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">For this type of offence you'll usually have to pay a fine</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">You must provide your income details. The court will decide your fine based on your finances and the seriousness of the offence</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Your details will be stored securely by the court.</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">Change to</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"></span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">For this type of offence you'll usually have to pay a fine</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">You must provide your income details</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">The court will decide your fine based on your finances and the seriousness of the offence</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Your details will be stored securely by the court</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">&nbsp;</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">Instruction text for question</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"></span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Would paying a fine cause you serious financial problems?</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">E.g. you would become homeless</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">Change to</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"></span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">For example, you would become homeless</span><span></span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">&nbsp;</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">--------------</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Behaviours</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">If the user selects the no option then no text is displayed and the user is directed to the review details screen once they select the continue button.</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">&nbsp;</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">When the user selects the yes option for the serious financial problems question, text is displayed underneath the options explaining that the user will have to provide information about their expenses on the next screen.</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Selecting continue directs the user to the expenses screen.</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">&nbsp;</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">If the user previously selected the yes option but then decided to select the no option the text is hidden and the user is directed to the review details screen when they select the continue button.</span></p>",O="style",P="baseStyle",Q="627587b6038d43cca051c114ac41ad32",R="pageAlignment",S="near",T="fill",U="fillType",V="solid",W="color",X=0xFFFFFFFF,Y="image",Z="imageHorizontalAlignment",ba="imageVerticalAlignment",bb="imageRepeat",bc="auto",bd="favicon",be="sketchFactor",bf="0",bg="colorStyle",bh="appliedColor",bi="fontName",bj="Applied Font",bk="borderWidth",bl="adaptiveStyles",bm="a",bn="b"